import request from '@/utils/request';
export default {
  save: function save(params) {
    return request({
      url: '/shop/goods/sku',
      method: 'post',
      data: params
    });
  },
  remove: function remove(id) {
    return request({
      url: '/shop/goods/sku',
      method: 'delete',
      params: {
        id: id
      }
    });
  }
};
